      out.write("          }        \r\n");
      out.write("           \r\n");
      out.write("          if (typeof o.closedClass != 'undefined'){        \r\n");
      out.write("          closedClass = o.closedClass;        \r\n");
      out.write("          }      \r\n");
      out.write("          };              \r\n");
      out.write("           \r\n");
      out.write("          //initialize each of the top levels        \r\n");
      out.write("          var tree = $(this);        \r\n");
      out.write("          tree.addClass(\"tree\");        \r\n");
      out.write("          tree.find('li').has(\"ul\").each(function () {            \r\n");
      out.write("          var branch = $(this); //li with children ul            \r\n");
      out.write("          branch.prepend(\"<i class='indicator glyphicon \" + closedClass + \"'></i>\");            \r\n");
      out.write("          branch.addClass('branch');            \r\n");
      out.write("          branch.on('click', function (e) {                \r\n");
      out.write("          if (this == e.target) {                    \r\n");
      out.write("          var icon = $(this).children('i:first');                    \r\n");
      out.write("          icon.toggleClass(openedClass + \" \" + closedClass);                    \r\n");
      out.write("          $(this).children().children().toggle();                \r\n");
      out.write("          }            \r\n");
      out.write("          })            \r\n");
      out.write("          branch.children().children().toggle();        \r\n");
